import React from 'react';
import Link from 'next/link';
// eslint-disable-next-line import/no-extraneous-dependencies
import PropTypes from 'prop-types';
import { Input, Menu } from 'antd';
import styled from 'styled-components';
import { CloseOutlined } from '@ant-design/icons';

const SearchInput = styled(Input.Search)`
  vertical-align: middle;
  ;
`;

const HomeLayout = ({ children }) => (
  <div>
    <Menu mode="horizontal" style={{ padding: '0.5rem 1rem', background: '#2c82c9' }}>
      <Menu.Item key="home">
        <Link href="/" style={{ marginRight: '1rem', color: '#ffff' }}><a>StudyBaord</a></Link>
      </Menu.Item>
      <Menu.Item key="profile">
        <Link href="/profile"><a>Profile</a></Link>
      </Menu.Item>
      <Menu.Item>
        <Link href="/studyBoard"><a> Ask Question </a></Link>
      </Menu.Item>
      <Menu.Item>
        <Link href="/about"><a>About </a></Link>
      </Menu.Item>
      <Menu.Item>
        <Link href="/rank"><a>Rank </a></Link>
      </Menu.Item>
      <Menu.Item>
        <SearchInput enterButton placeholder="type what you want" allowClear style={{ width: 400, color: '#2c82c9', borderRadius: '20px' }} />
      </Menu.Item>
      {/* <Menu.Item key="mail"> */}
      {/*    <Input.Search enterButton style={{ verticalAlign: 'middle' }} /> */}
      {/* </Menu.Item> */}
    </Menu>
    <div gutter={8}>
      { children }
    </div>

  </div>
);

HomeLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default HomeLayout;
